import pygame
from pygame.locals import *
from base64 import b64decode
def delay(ticks):
 time=pygame.time.get_ticks()
 newtime=pygame.time.get_ticks()
 while(newtime<(time+ticks)):
  eventproc()
  newtime=pygame.time.get_ticks()
def eventproc():
 for e in pygame.event.get():
  print(e)
  if(e.type==KEYDOWN and e.key==K_BACKSPACE):
   gameon=False
   pygame.quit()
  if(e.type==KEYDOWN and e.key==K_c):
   f.playsize()
  if(e.type==KEYDOWN and e.key==K_LEFT):
   f.decsize()
  if(e.type==KEYDOWN and e.key==K_RIGHT):
   f.incsize()
class field:
 size=1
 min=0
 max=10
 def setsize(self,s):
  if(s<self.min):
   s=min
   return False
  elif(s>self.max):
   s=max
   return False
  else:
   self.size=s
   return True
 def decsize(self):
  size=self.getsize()
  if(self.setsize((size-1))):
   dec.play()
 def incsize(self):
  size=self.getsize()
  if(self.setsize((size+1))):
   inc.play()
 def playsize(self):
  for i in (range(self.getsize())):
   unit.play()
   delay(100)
 def getsize(self):
  return(self.size)
